import React from 'react';
import 'mdb-react-ui-kit/dist/css/mdb.min.css'

function Videos(props) {
    return (
		<>
      <div className='video1'>
        <video
          src="https://www.notion.so/5f0735f643e74539b318cdc6e8ab11d0#cce70b32ee7a4e2c9cdf62d2d0658e1e"
          width="1280px"
          height="720px"
          controls
          autoplay
          loop>
          </video>
      </div>
		</>
    );
}


export default Videos;
